import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import DashboardPage from './pages/DashboardPage';
import ContractMessagePage from './pages/ContractMessagePage';
import ContractMessageDetails from './pages/ContractMessageDetails';
import './styles.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<DashboardPage />} />
        <Route path="/all-messages" element={<ContractMessagePage />} />
        <Route path="/message/:id" element={<ContractMessageDetails />} />
      </Routes>
    </Router>
  );
}

export default App;
